const style = {
  home: '',
};

function Button({ children, type }) {
  return (
    <button
      className={`border- rounded-full border-2 border-solid border-white bg-red-300 px-4    py-2 hover:bg-white ${style[type]}`}
    >
      {children}
    </button>
  );
}

export default Button;
